IF OBJECT_ID('dbo.proc_transform_326', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_326;
GO
CREATE PROCEDURE dbo.proc_transform_326
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_326
    SET payload = LEFT(payload, 1000) + N'|V4-326|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_326;
END
